      out.write("\tfunction clacImgZoomParam( maxWidth, maxHeight, width, height ){\r\n");
      out.write("\t\tvar param = {top:0, left:0, width:width, height:height};\r\n");
      out.write("\t\tif( width>maxWidth || height>maxHeight ){\r\n");
      out.write("\t\t\trateWidth = width / maxWidth;\r\n");
      out.write("\t\t\trateHeight = height / maxHeight;\r\n");
      out.write("\t\t\t\r\n");
      out.write("\t\t\tif( rateWidth > rateHeight ){\r\n");
      out.write("\t\t\t\tparam.width =  maxWidth;\r\n");
      out.write("\t\t\t\tparam.height = Math.round(height / rateWidth);\r\n");
      out.write("\t\t\t}else{\r\n");
      out.write("\t\t\t\tparam.width = Math.round(width / rateHeight);\r\n");
      out.write("\t\t\t\tparam.height = maxHeight;\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t}\r\n");
      out.write("\t\tparam.left = Math.round((maxWidth - param.width) / 2);\r\n");
      out.write("\t\tparam.top = Math.round((maxHeight - param.height) / 2);\r\n");
      out.write("\t\treturn param;\r\n");
      out.write("\t}\r\n");
